// PricingPlans.jsx

import React from "react";
import pricingData from "./pricingdata";
import Footer from "./Footer";
import { FaFireAlt, FaCheckCircle } from "react-icons/fa";
import "./PricingPlans.css";

const PricingPlans = () => {
  return (
    <div className="bg-[#0e0e0e] text-white min-h-screen w-full flex flex-col items-center px-6 py-10">
      {/* Hero Text */}
      <div className="text-center mb-16">
        <h1
          className="text-5xl sm:text-6xl md:text-7xl font-bold mb-6"
          style={{ fontFamily: "Cy Grotesk Grand, sans-serif" }}
        >
          Join Turo
        </h1>
        <img src="/your-logo.png" alt="Join Turo" className="mx-auto w-28" />
      </div>

      {/* Pricing Cards */}
      <div className="flex flex-col md:flex-row justify-center items-stretch gap-10 w-full max-w-7xl">
        {pricingData.map((plan, index) => (
          <div
            key={index}
            className="bg-gradient-to-br from-[#1a1a1a] to-[#222] p-6 rounded-3xl shadow-xl w-full md:w-1/3 flex flex-col justify-between"
          >
            <div>
              <div className="flex items-center gap-3 mb-4">
                <plan.icon className="text-pink-400 text-xl" />
                <h2 className="text-xl font-semibold text-white">{plan.title}</h2>
              </div>
              <p className="text-3xl font-bold text-white mb-3">{plan.price}</p>
              <p className="text-gray-400 mb-6 text-sm">{plan.description}</p>
              <div className="border-t border-gray-700 my-4"></div>
              <ul className="flex flex-col gap-3">
                {plan.features.map((feature, idx) => (
                  <li key={idx} className="flex items-center text-sm text-gray-300">
                    <plan.checkIcon className="text-green-400 mr-2 text-base" />
                    {feature}
                  </li>
                ))}
              </ul>
            </div>
            <button className="mt-8 py-3 bg-gradient-to-r from-[#934cff] to-[#2f7cf8] text-white text-sm font-medium rounded-lg hover:scale-105 transition-transform">
              Get Started
            </button>
          </div>
        ))}
      </div>

      {/* Footer */}
      <div className="mt-24 w-full">
        <Footer />
      </div>
    </div>
  );
};

export default PricingPlans;
